using Microsoft.AspNetCore.Identity;
using RandomNameGeneratorLibrary;
using Medicare.DAL.Models;

namespace Medicare.DAL.Storage;

public class DbInitializer
{
    private readonly MedicareContext _context;

    public DbInitializer(MedicareContext context)
    {
        _context = context;
    }

    public async Task AddSpecializations()
    {
        await _context.Specializations.AddRangeAsync(
            new[]
            {
                new Specialization(){ Name = "Surgery" },
                new Specialization(){ Name = "Urology" },
                new Specialization(){ Name = "Oncology" },
                new Specialization(){ Name = "Neurology" },
                new Specialization(){ Name = "Radiology" },
                new Specialization(){ Name = "Pathology" },
                new Specialization(){ Name = "Cardiology" },
                new Specialization(){ Name = "Geriatrics" },
                new Specialization(){ Name = "Hematology" },
                new Specialization(){ Name = "Nephrology" },
                new Specialization(){ Name = "Pediatrics" },
                new Specialization(){ Name = "Psychiatry" },
                new Specialization(){ Name = "Pulmonology" },
                new Specialization(){ Name = "Orthopedics" },
                new Specialization(){ Name = "Dermatology" },
                new Specialization(){ Name = "Rheumatology" },
                new Specialization(){ Name = "Endocrinology" },
                new Specialization(){ Name = "Ophthalmology" },
                new Specialization(){ Name = "Otolaryngology" },
                new Specialization(){ Name = "Anesthesiology" },
                new Specialization(){ Name = "Gastroenterology" },
                new Specialization(){ Name = "Infectious Disease" },
                new Specialization(){ Name = "Allergy and Immunology" },
                new Specialization(){ Name = "Obstetrics and Gynecology" },
                new Specialization(){ Name = "Physical Medicine and Rehabilitation" }
            });

        await _context.SaveChangesAsync();
    }

    public async Task AddDoctors()
    {
        var nameGenerator = new PersonNameGenerator();
        var rand = new Random();

        var doctors = new List<User>();

        var descriptions = new string[]
        {
            "Highly skilled and experienced medical professional, known for compassionate care and dedication to patient well-being. I have a strong background in internal medicine, with over 15 years of practice in both hospital and clinical settings. I am committed to staying current with the latest medical advancements and incorporates evidence-based practices in my treatment plans. I believe in a holistic approach to healthcare, addressing not only the physical but also the emotional and mental needs of my patients. Patients appreciate my thoroughness, empathy, and ability to explain complex medical issues in an understandable manner.",
            "Respected physician with a passion for preventive medicine and health education. With a career spanning over two decades, I have helped countless patients achieve better health outcomes through personalized care and attention to detail. My expertise lies in family medicine, where I treat patients of all ages, from infants to the elderly. I emphasize the importance of lifestyle modifications, such as diet and exercise, in managing chronic conditions. Known for my excellent communication skills, I ensure that patients feel heard and involved in my healthcare decisions.",
            "Innovative and patient-centered doctor, renowned for my work in the field of cardiology. I have a proven track record of successfully diagnosing and treating a wide range of heart conditions, utilizing the latest technology and treatment modalities. Dr. Jordan is dedicated to continuous learning and often participates in research studies to advance the field of cardiology. I take the time to educate my patients about heart health, prevention strategies, and treatment options. Colleagues and patients alike admire Dr. Jordan's dedication, expertise, and compassionate approach to care.",
            "Distinguished pediatrician with over 10 years of experience in child healthcare. I am known for gentle and caring approach, making children feel comfortable and at ease during visits. I stay updated with the latest advancements in pediatrics and regularly attends professional development workshops. I am passionate about preventive care and work closely with parents to ensure their children grow up healthy and strong. Parents appreciate my ability to communicate effectively and provide thorough explanations regarding their child's health.",
            "Renowned orthopedic surgeon, specializing in sports injuries and joint replacement surgeries. With a meticulous approach to surgical procedures, I have successfully performed numerous complex surgeries, restoring mobility and improving the quality of life for many patients. I am committed to patient education, ensuring that individuals understand my treatment options and the recovery process. I am actively involved in research and development of minimally invasive surgical techniques. Patients and colleagues praise my precision, dedication, and empathetic bedside manner.",
            "Highly regarded dermatologist with a focus on both medical and cosmetic dermatology. I have extensive experience in diagnosing and treating a wide range of skin conditions, from acne to skin cancer. I am known for personalized approach, tailoring treatments to meet the unique needs of each patient. I am dedicated to using the latest technologies and treatments to achieve the best possible outcomes. Patients appreciate my thoroughness, attention to details, and ability to make them feel confident and cared for."
        };

        var images = new string[]
        {
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,"
        };

        for (int i = 0; i < 100; i++)
        {
            var fullName = i % 2 == 0 ?
                nameGenerator.GenerateRandomMaleFirstAndLastName() :
                nameGenerator.GenerateRandomFemaleFirstAndLastName();

            var email = fullName.Split(" ")[0] + $"{rand.Next(100, 1000)}@example.com";

            var user = new User()
            {
                IsPatient = false,
                Email = email,
                UserName = email,
                FullName = fullName,
                Avatar = images[i % images.Count()],
                Description = descriptions[rand.Next(descriptions.Count())],
                PasswordHash = new PasswordHasher<User>().HashPassword(null!, "test")
            };

            await _context.Users.AddAsync(user);
            await _context.SaveChangesAsync();

            int randSpecIndex = rand.Next(_context.Specializations.Count() - 1);

            var specId = _context.Specializations.Skip(randSpecIndex).FirstOrDefault()!.Id;

            var spec = new UserSpecialization()
            {
                UserId = user.Id,
                SpecializationId = specId
            };

            await _context.UserSpecializations.AddAsync(spec);
            await _context.SaveChangesAsync();
        }
    }
}
